function sendModalForm(form)
{
	if (form.find('.has-error').length) {
		return false;
	}
	$.ajax({
		url: form.attr('action'),
		type: 'post',
		data: form.serialize(),
		success: function (data) {
            if ($(form).attr('data-no-submit-close')) {
                $('.modal form')[0].reset();
                restoreButtonSaving($('.modal form').find('[type=submit]'));
                $('.modal .grid-view').yiiGridView('applyFilter');
            }
            else if ($(form).attr('data-submit-redirect')) {
                document.location.href = data;
            }
            else if ($(form).attr('data-submit-load-data')) {
                var $modalContent = $(form).closest('.modal-content');
                $modalContent.html(data);
                loadAfterContentLoaded();
            }
            else {
                $(form).closest('.modal').modal('hide');
                if ($('.page-content .grid-view:first').length) {
                    $('.page-content .grid-view:first').yiiGridView('applyFilter');
                }
            }
		}
	});

	return false;
}

function init_polyfills() {
    // Initialize placeholder polyfill
    $('input, textarea').placeholder();
}

function redirectWithSave (url, name, data) {
    var data_json = JSON.stringify(data);

    $.post('/user/set_flash?name=' + name, data_json, function (data_received) {
        window.location.href = url;
    });
}

function getFormData(id)
{
    return $('#'+id).serialize();
}
