var selected_ids = [];
var allSelected = false;

function getSelectedIds (id) {
    selected_ids = [];
    var selector;
    if (id == undefined) {
        selector = '.grid-view';
    }
    else {
        selector = '#' + id;
    }

    var checkboxes = $(selector + ' input[name="selection[]"]:checked');
    $(checkboxes).each(function (key, item) {
        var checkbox_id = $(item).val();
        selected_ids.push(checkbox_id);
    });

    selected_ids = selected_ids.filter(onlyUnique);

    return selected_ids;
}


function showHideSelectAllButton(id) {

    var selector;

    if (id == undefined) {
        selector = '.grid-view';
    }
    else {
        selector = '#' + id;
    }

    var checkedAll = $('.kv-all-select .select-on-check-all').is(':checked');
    var isPagination = $(selector).find('.pagination').length > 0;

    if(!checkedAll || !isPagination) {
        $('.delete-all-group').addClass('hidden');
    } else {
        $('.delete-all-group').removeClass('hidden');
    }
}

function saveNewListOfSelectedIds (gridId) {
    getSelectedIds(gridId);

    if (selected_ids.length > 0) {
        $('.multi-action').removeClass('hidden');
    }
    else {
        $('.multi-action').addClass('hidden');
    }

    showHideSelectAllButton(gridId);
}


function getSelectedColumnsInGrid () {
    return $('input[name="selection[]"]:checked');
}


function arrayToQuery (ids, variable, includeQuestionMark) {
    var query;
    if (includeQuestionMark === undefined || includeQuestionMark === true) {
        query = '?' + variable + '[]=';
    }
    else {
        query = variable + '[]=';
    }
    query = query + ids.join('&' + variable + '[]=');
    return query;
}

function selectAllInView() {
    $('.all-selected').addClass('hidden');
    $('.all-selected-notavailable').addClass('hidden');

    $('.unselect-all').removeClass('hidden');
    allSelected = true;
}

function clearSelectionOfWholeView() {
    $('.all-selected').removeClass('hidden');
    $('.all-selected-notavailable').removeClass('hidden');

    $('.unselect-all').addClass('hidden');
    allSelected = false;
}

function getAllSelectedCount() {
    return parseInt($('.all-selected-count').text());
}

function getFilters(id) {
    var selector;
    var filters = {};

    if (id == undefined) {
        selector = '.grid-view';
    }
    else {
        selector = '#' + id;
    }

    var searchTerm = $('.search-form').find('input[name="searchterm"]').val();
    var type = $('.message-type').val();

    $(selector).find('.filters input').not('.select2-focusser, .select2-input').each(function(index, elem){
        var filterName = $(elem).attr('name').match(/\[\w+\]/)[0].match(/\w+/);
        filters[filterName] = $(elem).val();
    });

    $(selector).find('.filters select').each(function(index, elem){
        var filterName = $(elem).attr('name').match(/\[\w+\]/)[0].match(/\w+/);
        filters[filterName] = $(elem).val();
    });

    filters.search = searchTerm;
    filters.type = type;

    return filters;
}
