function processStatisticsChange(form)
{
    var $form = $(form);
    var $activeButton = $form.find('.btn.active');;
    var type = $activeButton.attr('rel');
    var action = $form.attr('action');

    $form.find('[name=start_date_day],[name=start_date_month]').addClass("hidden");

    var data = {};
    data.form_id = $form.attr('rel');
    data.date = {};
    data.date.year = $form.find('[name=start_date_year]').val();

    $('#'+data.form_id).addClass('loading');

    if ($form.find('[name=value_type]').length) {
        data.value_type = $form.find('[name=value_type]').val();
    }

    if (type == 'statistics-month') {
        $form.find('[name=start_date_month]').removeClass('hidden')
        data.date.month = $form.find('[name=start_date_month]').val();
    }

    if (type == 'statistics-week') {
        data.week = 1;
    }

    if (type == 'statistics-day') {
        $form.find('[name=start_date_month]').removeClass('hidden')
        $form.find('[name=start_date_day]').removeClass('hidden')
        data.date.month = $form.find('[name=start_date_month]').val();
        data.date.day = $form.find('[name=start_date_day]').val();
    }

    data.time = $.now();
    if (action.match(/graphic/)) {
        $.getScript(action + '?' + $.param(data), function () {
            $('#'+data.form_id).removeClass('loading');
        }).fail(function () {
            $('#'+data.form_id).html("Error loading data..").css('min-height', '0').css('_height', '0').css('color', 'red').removeClass('loading');
        });
    } else {
        $.get(action + '?' + $.param(data), function (htmlData) {
            $('#'+data.form_id).html(htmlData).removeClass('loading');
        })
    }

}
