function init_select2 (force) {
    // Select2
    if (force) {
        $('.select2').select2('destroy');
    }
    var selector = (force) ? 'select.select2' : 'select.select2:not(.select2-filtered)';

    var selectorWidthClear = selector + '.select2-full-width[data-allow-clear=true]';
    var selectorNotWidthClear = selector + ':not(.select2-full-width)[data-allow-clear=true]';

    var selectorWidth = selector + '.select2-full-width';
    var selectorNotWidth = selector + ':not(.select2-full-width)';

    $(selectorWidthClear).select2({
        minimumResultsForSearch: 10,
        width: '100%',
        allowClear: true,
        formatNoMatches: function () {
            return no_results;
        }
    });
    $(selectorWidthClear).addClass('select2-filtered');

    $(selectorWidth).select2({
        minimumResultsForSearch: 10,
        width: '100%',
        formatNoMatches: function () {
            return no_results;
        }
    });
    $(selectorWidth).addClass('select2-filtered');

    $(selectorNotWidthClear).select2({
        minimumResultsForSearch: 10,
        allowClear: true,
        width: 'resolve',
        formatNoMatches: function () {
            return no_results;
        }
    });
    $(selectorNotWidthClear).addClass('select2-filtered');

    $(selectorNotWidth).select2({
        minimumResultsForSearch: 10,
        width: 'resolve',
        formatNoMatches: function () {
            return no_results;
        }
    });
    $(selectorNotWidth).addClass('select2-filtered');
}


