function activateCustomCharacterCounter ( id, maxChars )
{
    $('#'+id).bind('keyup focus blur', function () {
        calcCharLeft(this, maxChars);
    });
}

function calcCharLeft (input, characters)
{
    if ( characters == undefined ) {
        characters = 160;
    }

    var theSMS     = input.value;
    var availChars = characters - calcSpecialChars(theSMS);

    if (theSMS.length > availChars)
    {
        input.value = theSMS.substring(0, availChars);
        theSMS      = input.value;
        input.scrollTop = 9999;
        alert('Een SMS-bericht kan maximaal ' + characters + ' tekens bevatten.');
    }
    $(input).parent().find('span.counter').text(availChars - theSMS.length);
}

function calcSpecialChars (message)
{
    var two_chars = ["\n", "\\", '^', '~', '[', ']', '{', '}', '|', '', '', ''];
    var two_chars_count = 0;

    for (var j=0; j<message.length; j++)
        for (var i=0; i<two_chars.length; i++)
            if (message.charAt(j) == two_chars[i])
                two_chars_count++;

    return two_chars_count;
}/*** END FILE: /var/www/messagebird/releases/20171127154955/backend/web/assets/87209828/js/settings.js ***/
