function fixedStepNav(){
    var btn = document.querySelector('input[type="submit"]');
    var stepNav = document.querySelector('.step-navigator.bottom');
    var container = document.querySelector('.step-navigator.bottom .step-navigator-container');
    var main = document.getElementById('wrapper-main');

    $(window).on('DOMContentLoaded load resize scroll', function(){

        var distanceFromBottom = document.body.scrollHeight - window.innerHeight - window.scrollY;
        var right = (window.innerWidth - main.offsetWidth) / 2;
        var pjaxMainPadding = parseInt(getComputedStyle(document.querySelector('.main-content')).getPropertyValue('margin-right'), 10);

        btn.style.right = right + pjaxMainPadding + 15 + 'px';

        if ( distanceFromBottom >= 120 && btn.style.position !== 'fixed' ){
            btn.style.position = 'fixed';
            btn.style.bottom = '10px';
            container.style.transform = 'initial';
            stepNav.style.borderWidth = 0;
        } else if ( distanceFromBottom < 120 && btn.style.position === 'fixed') {
            btn.style.position = null;
            btn.style.bottom = null;
            btn.style.right = null;
            container.style.transform = null;
            stepNav.style.borderWidth = '1px';
        }
    });
};

