/**
 * CREDITS
 *
 * @param amount
 */
calculator.setPricingBuyNow = function (amount, type) {
    if (type == 'price') {
        var price = parseFloat(amount);
        amount = 1;
    } else {
        var price = getPriceFromAmount(amount);
    }

    if (typeof vatLevelIn !== 'undefined') {
        var multiplier_incl_vat = (vatLevelIn+100)/100;
        var multiplier_vat = vatLevelIn/100;
    } else {
        var multiplier_incl_vat = 1.21;
        var multiplier_vat = 0.21;
    }

    var price_html = new String(calculator.priceFormatter(price, 3)).replace(".", ",");
    var price_total_ex_html = new String(calculator.priceFormatter(price * amount, 2)).replace(".", ",");
    var price_total_in_html = new String(calculator.priceFormatter(calculator.priceFormatter(price * amount, 2) * multiplier_incl_vat, 2)).replace(".", ",");
    var price_total_vat_html = new String(calculator.priceFormatter(calculator.priceFormatter(price * amount, 2) * multiplier_vat, 2)).replace(".", ",");

    if (price_total_ex_html.match(/,/) == null) {
        price_total_ex_html = price_total_ex_html + ',00';
    }
    if (price_total_vat_html.match(/,/) == null) {
        price_total_vat_html = price_total_vat_html + ',00';
    }
    if (price_total_in_html.match(/,/) == null) {
        price_total_in_html = price_total_in_html + ',00';
    }

    $('#credits_balance_price_each').html(price_html);
    $('#credits_balance_amount').html(amount);
    $('#credits_balance_vat').html(price_total_vat_html);
    $('#credits_balance').html(price_total_ex_html);
    $('#order_amount').val(price * amount);
    $('#credits_balance_in').html(price_total_in_html);
}


calculator.priceFormatter = function ( price, decimal )
{
	price.toFixed(3);
	/** Checks if price is an integer **/
	if ( price == parseInt(price) )
	{
		return price;
	}
	 /**Checks if price has only 1 decimal **/
	else if ( Math.round(price * 10) / 10 == price )
	{
		return price.toFixed(decimal);
	}
	 /** Checks if price has only 1 decimal **/
	else if ( Math.round(price * 100) / 100 == price )
	{
		return price.toFixed(decimal);
	}
	 /** Covers other cases **/
	else
	{
		return price.toFixed(decimal);
	}
}

