function CreditOrder() {

    var self = this;

    this.init = function () {

        if ($('#credit-amount').length === 0) {
            return false;
        }

        // Initial values
        this.type = 'credit-amount';
        this.taxPercentage = $('.calculator').data('tax-percent') / 100;
        this.credits = '';
        this.priceSms = '0.055';

        var $typeSelector = $('.buy-calculator [name=type]');
        var $countrySelector = $('.buy-calculator [name=country]');

        $('.credit-type-toggle').on('change', function() {
            self.setType( $(this).data('credit-type') );

            if ( self.type !== 'credit-amount' ) {
                $('.buy-calculator').find('.not-allowed-cover').hide();
                $('.buy-enter').find('.not-allowed-cover').show();
            }
            else {
                $('.buy-calculator').find('.not-allowed-cover').show();
                $('.buy-enter').find('.not-allowed-cover').hide();
            }

            updateCalculation();
        });

        $('[name=country], [name=type]').bind('change keyup paste blur focus', function () {
            updateCalculation();
        });

        $('#credit-amount, #sms-amount').bind('change keyup paste blur focus', function() {
            updateCalculation();
        });

        $('.not-allowed-cover').on('click', function(){

        });

        function updateCalculation(){
            if ( self.type === 'credit-amount' ) {
                self.setCredits( $('#credit-amount').val() );
            } else if ( self.type === 'sms-amount' ) {
                self.setPriceSms(getPrice($countrySelector.val(), $typeSelector.val()) / 100);
                self.setCredits( $('#sms-amount').val() * self.priceSms );
            }
            self.calculate();
        }
    };

    this.setType = function (type) {
        this.type = type;
    };

    this.setCredits = function (credits) {
        this.credits = credits;
        $('[name=amount]').val(credits);
    };

    this.setPriceSms = function (priceSms) {
        this.priceSms = priceSms;
    };

    this.showCreditsSMS = function() {
        if ( this.type === 'credit-amount' ) {
            $('input#credit-amount').val( this.credits ).change();
            $('input#sms-amount').val('');
        }
        else if ( this.type === 'sms-amount' ) {
            $('input#credit-amount').val('');
            $('input#sms-amount').val( Math.ceil( this.credits / this.priceSms ) ).change();
        }
    };

    this.calculate = function () {
        var taxTotal = this.credits * this.taxPercentage;
        var priceExVat = parseFloat( this.credits );
        var priceTotal = taxTotal + priceExVat;

        $('.price-exvat').text ( formatMoney(priceExVat) );
        $('.price-vat').text( formatMoney(taxTotal) );
        $('.price-total').text( formatMoney(priceTotal) );
    };

    this.init();
}

/**
 * @param country_id
 * @param type
 * @returns {*}
 */
function getPrice(country_id, type) {
    if (type == 'voice') {
        return pricing_voice[country_id]*100;
    } else {
        return pricing[country_id]*100;
    }
}

function formatMoney (n, c, d, t){
    var c = isNaN(c = Math.abs(c)) ? 2 : c;
    var d = decimal_seperator == undefined ? "." : decimal_seperator;
    var t = thousand_seperator == undefined ? "," : thousand_seperator;
    var s = n < 0 ? "-" : "";
    var i = parseInt(n = Math.abs(+n || 0).toFixed(c)) + "";
    var j = (j = i.length) > 3 ? j % 3 : 0;
    return s + (j ? i.substr(0, j) + t : "") + i.substr(j).replace(/(\d{3})(?=\d)/g, "$1" + t) + (c ? d + Math.abs(n - i).toFixed(c).slice(2) : "");
 };

