jQuery.fn.addRecipient = function(type, id, label, count) {
    label = typeof label !== 'undefined' ? label : type + " - " + id;
    count = typeof label !== 'undefined' ? count : 1;

    var template = $("div#recipient-template div").first().clone(true);
    var input_id = type + "-input-template";
    var input_template = $("div#"+input_id).first().clone(true).removeAttr("id");
    input_template.find("input").first().val(id);
    template.find("div.fancy-label").first().text(label);
    template.append(input_template);
    template.find("div.delete-recipient").data("type", type).data("id", id).data("count", count);

    $("span#recipient-count").updateCounter(count);
    $("div.field-messageform-recipients").hasSuccess();
    $(this).find("div#recipients").append(template);
};

jQuery.fn.removeRecipient = function() {
    var container = $(this).closest("div.recipient-container").first();
    $("span#recipient-count").updateCounter(parseInt($(this).data("count")) * -1);
    container.remove();
};

jQuery.fn.updateCounter = function(delta) {
    var current = parseInt($(this).text());
    $(this).text(current + parseInt(delta));
};


jQuery.fn.hasError = function(message){
    $(this).addClass('error');
    $(this).find("span.error-msg").html(message);
};

jQuery.fn.hasSuccess = function() {
    $(this).removeClass('error');
    $(this).find("span.error-msg").empty();
};


$.fn.messageForm = function(options, param) {
    this.currentStep = function() {
        var step = $("div.step.active").data("step");
        if(step == 'undefined') {
            return null;
        } else {
            return step;
        }
    };

    this.messageType = function() {
        if($("textarea#editor").data("message-type") == "sms"){
            return "sms";
        } else {
            return "voice";
        }
    };

    this.handleStep1 = function(errors) {
        var success = true;
        if (errors.hasOwnProperty("messageform-body")) {
            $("div.field-messageform-body").hasError(errors["messageform-body"]);
            success = false;
        } else {
            $("div.field-messageform-body").hasSuccess();
        }

        if (errors.hasOwnProperty("messageform-language")) {
            $("div.field-messageform-language").hasError(errors["messageform-language"]);
            success = false;
        } else {
            $("div.field-messageform-language").hasSuccess();
        }

        if (errors.hasOwnProperty("messageform-voice")) {
            $("div.field-messageform-voice").hasError(errors["messageform-voice"]);
            success = false;
        } else {
            $("div.field-messageform-voice").hasSuccess();
        }

        if (errors.hasOwnProperty("messageform-repeat")) {
            $("div.field-messageform-repeat").hasError(errors["messageform-repeat"]);
            success = false;
        } else {
            $("div.field-messageform-repeat").hasSuccess();
        }
        return success;
    };

    this.handleStep2 = function(errors) {
        var success = true;
        if (errors.hasOwnProperty("messageform-originator")) {
            $("div.field-messageform-originator").hasError(errors["messageform-originator"]);
            success = false;
        } else {
            $("div.field-messageform-originator").hasSuccess();
        }

        if (errors.hasOwnProperty("messageform-recipients")) {
            $("div.field-messageform-recipients").hasError(errors["messageform-recipients"]);
            success = false;
        } else {
            $("div.field-messageform-recipients").hasSuccess();
        }

        if (success) {
            if ($('#send-sms, #schedule-sms').prop('disabled')) {
                $('#send-sms, #schedule-sms').prop('disabled', true);
                setTimeout( function(){ $('#send-sms, #schedule-sms').prop('disabled', false) }, 1000);
            }
        }
        return success;
    };

    this.handleStep3 = function(errors) {
        var success = true;
        if (errors.hasOwnProperty("messageform-end_datetime")) {
            $("div.field-messageform-end_datetime").hasError(errors["messageform-end_datetime"]);
            success = false;
        } else {
            $("div.field-messageform-end_datetime").hasSuccess();
        }
        if (errors.hasOwnProperty("messageform-start_datetime")) {
            $("div.field-messageform-start_datetime").hasError(errors["messageform-start_datetime"]);
            success = false;
        } else {
            $("div.field-messageform-start_datetime").hasSuccess();
        }
        if (errors.hasOwnProperty("messageform-balance")) {
            $("#insufficient-balance").show().fadeOut(100).fadeIn(300);
            success = false;
        } else {
            $("#insufficient-balance").hide();
        }
        return success;
    };

    this.handleErrors = function(errors) {
        if(this.currentStep() === null) {
        } else {
            switch(this.currentStep()) {
                case 1:
                    return this.handleStep1(errors);
                    break;
                case 2:
                    //console.log(errors);
                    return this.handleStep2(errors);
                    break;
                case 3:
                    return this.handleStep3(errors);
                    break;
                default:
                    return false;
                //console.log("no idea what to do");
            }
        }
    };

    this.nextStep = function(){
        if(this.currentStep() == 3) {
            return false;
        } else {
            return this.currentStep() + 1;
        }
    };

    this.prevStep = function(){
        if(this.currentStep() == 1) {
            return false;
        } else {
            return this.currentStep() - 1;
        }
    };

    this.processAddMsisdn = function(element) {
        var $element = $(element);
        var msisdn = $(element).val();
        var hasPlusSign = msisdn.indexOf("+") >= 0;

        var errorMsg = $element.data("error-message");
        var defaultPrefix = $element.data("default-prefix");

        /**
         * Remove all non intchars
         */
        msisdn = msisdn.replace(/[^0-9]+/g, '');

        if (msisdn == '') {
            return false;
        }

        /**
         * Fix users that send to a number without international
         */
        if (msisdn.substr(0, 2) == '00') {
            msisdn = msisdn.replace(/^[0]+/, "");
        }

        if ((msisdn.length <= 9 && !hasPlusSign) || msisdn.substr(0, 1) == 0) {
            msisdn = defaultPrefix + msisdn.replace(/^[0]+/, "");
        }

        var patternStr = /^\d{9,18}$/;
        var pattern = new RegExp(patternStr);
        var valid = pattern.test(msisdn);
        if(valid){
            var label = "+" + msisdn;
            this.addRecipient("msisdn", msisdn, label, 1);
            $(element).val("");
        } else if (errorMsg) {
            this.triggerError(errorMsg);
            return false;
        }
        return true;
    };

    this.beforeProceed = function() {
        if (this.currentStep() == 2) {
            var $quickNumberInput = $("#quick-number-input");
            return this.processAddMsisdn($quickNumberInput);
        }
    };

    this.proceed = function() {
        var next_step = this.nextStep();

        if(next_step !== false) {
            if(next_step == 3) {
                this.getInfo();
            }
            this.gotoStep(next_step);
            return true;
        }
        if(this.currentStep() == 3) {
            this.submit();
        }
    };

    this.previous = function() {
        var prev_step = this.prevStep();
        if(prev_step !== false) {
            this.gotoStep(prev_step);
        }
    };

    this.gotoStep = function(step) {
        var next_div_class = "step-" + step;
        var current_div_class = "step-" + this.currentStep();
        $("ul#progressbar li.current").removeClass("current");
        $("ul#progressbar li a[data-step='"+step+"']").parent("li").addClass("current");
        $("div.step."+current_div_class).removeClass("active").hide().addClass("hidden");
        $("div.step."+next_div_class).addClass("active").removeClass("hidden").show();
        // Set the link to "visited" on the bottom navigation
        $("ul#progressbar li a[data-step='"+step+"']").addClass('visited');
        $("div.step-navigator").removeClass(current_div_class).addClass(next_div_class);
    };

    this.validate = function() {
        this.beforeProceed();
        var extData = '&ajax=true';
        var form = this;
        $.ajax({
            url: this.attr('action'),
            type: 'POST',
            data: form.serialize() + extData,
            dataType: "json",
            complete: function (jqXHR, textStatus) {
            },
            beforeSend: function (jqXHR, settings) {
                $(".messageform-validation").hide();
            },
            success: function (msgs) {
                var result = form.handleErrors(msgs.errors);
                if (result == true) {
                    form.proceed();
                }
            },
            error: function () {
                data.submitting = false;
            }
        });
    };

    this.handleInfo = function(data) {
        $("table#insufficient-balance").addClass("hidden");
        $("div.step-3 #originator").text(data.originator);

        if (location.href.match(/send-voice/)) {
            var r = [];
            for (var i = 0; i < data.repeat - 1; i++){
                r.push(data.body);
            }
            $("div.step-3 p#body").text(r.join(', '));
        } else {

            $("div.step-3 p#body").text(data.body);
        }

        $("div.step-3 #recipient-total").text(data.recipientCount);
        $("div.step-3 #repeat").text((parseInt(data.repeat)) + 'x');

        $("div.step-3 #balance-needed").text(data.balanceNeededFormatted);
        if(data.enoughBalance === false) {
            $("table#insufficient-balance").removeClass("hidden");
            $("div#nextprev button").attr("disabled", true);
        }
    };

    this.getInfo = function() {
        var extData = '&ajax=true&status=true';
        var form = this;
        $.ajax({
            url: this.attr('action'),
            type: 'POST',
            data: form.serialize() + extData,
            dataType: "json",
            complete: function (jqXHR, textStatus) {
            },
            beforeSend: function (jqXHR, settings) {
            },
            success: function (msgs) {
                form.handleInfo(msgs.info);
            },
            error: function () {
                data.submitting = false;
            }
        });
    };

    if( typeof(this[options]) === 'function' ) {
        return this[options](param);
    }
};

jQuery.fn.triggerError = function(message) {
    alert(message);
    //console.log(message);
};

jQuery.fn.enterKey = function (fnc) {
    return this.each(function () {
        $(this).keypress(function (ev) {
            var keycode = (ev.keyCode ? ev.keyCode : ev.which);
            if (keycode == '13') {
                fnc.call(this, ev);
            }
        })
    })
};


