// Add a method to jQuery to check for an extension
// Source: http://stackoverflow.com/questions/4234589/validation-of-file-extension-before-uploading-file/17355937#17355937
$.fn.hasExtension = function (exts) {
    return (new RegExp('(' + exts.join('|').replace(/\./g, '\\.') + ')$')).test($(this).val());
};


function onlyUnique (value, index, _self) {
    return _self.indexOf(value) === index;
}

function alphaWarning(){
    $('#messageform-originator').keypress(function(){
        var sender = $(this);
        var string = sender.val();
        sender.on('keyup', function(){
            if ( /[a-z]/i.test(string) === true ){
                $("#alpha-notice").show();
            } else {
                $("#alpha-notice").hide();
            }
        });
    });
}

function loadAfterContentLoaded () {
    init_select2(false);
    customCheckRadio();
    init_polyfills();
    styleEditorFocus();
    activateUploadButton();
    activatePlaceholders();
    loadAutofocus();
    activateTooltip();
}

